import React, { createContext, useEffect } from "react";
import { BrowserRouter, Link, Route, Routes } from "react-router-dom";
import Create from "./create";
import Update from "./update";
import Read from "./read";
import { UsersContext } from "./apk";


export default function Layout(){



    return(
        <>
        <BrowserRouter>
        <ul class="nav nav-tabs" id="navId">
            <li class="nav-item">
            <Link to={'/users/create'} class="nav-link active">Ajouter</Link>
             
                
            </li>
            <li class="nav-item">
           
               <Link to={'/users/:id/Update'} class="nav-link active">Update</Link>
            
            </li>
            <li class="nav-item">
           
           <Link to={'/users/Read'} class="nav-link active">User table</Link>
        
        </li>
        </ul>
        

        <Routes>
        <Route path="/" element={<Read />}/>
            <Route path="/users/create" element={<Create />}/>
            <Route path="/users/:id/Update" element={<Update/>}/>
            <Route path="/users/Read" element={<Read/>}/>
            <Route path="/users/${user.id/Delete" element={<Read/>}/>
        </Routes>
        </BrowserRouter>
     
        
      
        </>
    )
}
